  <script type="text/javascript">
    // SINGLE PAGE APPS GITHUB PAGES WORKAROUND
    // Checks if the 404.html redirected us here with a "?p=..." query

    const searchParams = new URLSearchParams(window.location.search);
    const redirectPath = searchParams.get('p');

    if (redirectPath) {
      // If we have a redirect path, replace the current URL with it.
      // This removes the "?p=" and puts the clean URL back in the address bar
      // BEFORE React/Router loads.
      window.history.replaceState(null, null, redirectPath);
    }
  </script>
